// scripts\ticketActions.js
document.getElementById('print-btn').addEventListener('click', () => {
  const ticket = document.querySelector('.ticket');
  if (!ticket) return alert('No se encontró el ticket.');

  const parentElem = ticket.children[5].children[1];
  const referenceNode = parentElem.children;
  if (!parentElem || !referenceNode) {
    alert('Estructura del ticket inesperada.');
    return;
  }

  // Crear el div .dev y añadirlo justo después de referenceNode
  const devDiv = document.createElement('div');
  devDiv.className = 'dev';
  devDiv.textContent = 'Dev.: FIGUEROA PEREZ, Franklin';

  // Insertar después de referenceNode
  if (referenceNode.nextSibling) {
    parentElem.insertBefore(devDiv, referenceNode.nextSibling);
  } else {
    parentElem.appendChild(devDiv);
  }
    window.print();
  // Eliminar el div dev para dejar limpio el DOM
  if (devDiv.parentNode) {
    devDiv.parentNode.removeChild(devDiv);
  }
});

document.getElementById('download-btn').addEventListener('click', () => {
  const ticket = document.querySelector('.ticket');
  if (!ticket) return alert('No se encontró el ticket.');
  const wrapper = document.getElementById("ticket-wrapper")
  if (!wrapper) return alert("Ocurrión un error en la extensión del comedor")
  
  if (ticket.classList.contains('clasico')){
    ticket.style.padding = '20px 25px';
    ticket.style.width = '71mm';
    wrapper.style.width = '71mm'
  }else{
    ticket.style.padding = '20px 11px';
    ticket.style.width = '71mm';
  }


  const parentElem = ticket.children[5].children[1];
  const referenceNode = parentElem.children;
  if (!parentElem || !referenceNode) {
    alert('Estructura del ticket inesperada.');
    return;
  }

  // Crear el div .dev y añadirlo justo después de referenceNode
  const devDiv = document.createElement('div');
  devDiv.className = 'dev';
  devDiv.textContent = 'Dev.: FIGUEROA PEREZ, Franklin';

  // Insertar después de referenceNode
  if (referenceNode.nextSibling) {
    parentElem.insertBefore(devDiv, referenceNode.nextSibling);
  } else {
    parentElem.appendChild(devDiv);
  }

  // Crear las imágenes de borde superior e inferior usando chrome.runtime.getURL
  const base64Border = 'data:image/png;base64,'; // pon aquí tu cadena Base64 completa

  const borderTop = document.createElement('img');
  borderTop.src = base64Border;
  borderTop.style.width = '100%';
  borderTop.style.display = 'block';
  borderTop.className = 'border-top-temp';

  const borderBottom = document.createElement('img');
  borderBottom.src = base64Border;
  borderBottom.style.width = '100%';
  borderBottom.style.display = 'block';
  borderBottom.className = 'border-bottom-temp';

  // Insertar el borde superior al inicio y el borde inferior al final del ticket
  if (ticket.classList.contains('clasico')) {
    ticket.insertBefore(borderTop, ticket.firstChild);
    ticket.appendChild(borderBottom);
  } 
  

  // Esperar a que ambas imágenes carguen antes de capturar con html2canvas
  let loadedCount = 0;
  function onImageLoad() {
    loadedCount++;
    if (loadedCount === 2) {
      // Ambas imágenes cargadas, capturar
      html2canvas(wrapper, { scale: 2, backgroundColor: '#fff' })
        .then(canvas => {
          const link = document.createElement('a');
          link.download = `ticket_unsch_${new Date().toISOString().replace(/[:.]/g, '-')}.png`;
          link.href = canvas.toDataURL('image/png');
          document.body.appendChild(link);
          link.click();
          document.body.removeChild(link);
        })
        .catch(() => alert('Error al generar la imagen del ticket'))
        .finally(() => {
          // Eliminar el div dev para dejar limpio el DOM
          if (devDiv.parentNode) {
            devDiv.parentNode.removeChild(devDiv);
          }
          // Eliminar las imágenes de borde
          if (borderTop.parentNode) {
            borderTop.parentNode.removeChild(borderTop);
          }
          if (borderBottom.parentNode) {
            borderBottom.parentNode.removeChild(borderBottom);
          }

          //  eliminamos lo estilos inline
          ticket.removeAttribute('style');
          wrapper.removeAttribute('style');

        });
    }
  }

  borderTop.onload = onImageLoad;
  borderBottom.onload = onImageLoad;
});

// para el boton de eleccion de estilo
document.getElementById('toggle-style-btn').addEventListener('click', () => {
  const ticket = document.getElementById('ticket-container');
  const label = document.getElementById('current-style-label');
  const btn = document.getElementById('toggle-style-btn');
  const body = document.body; // obtener elemento body

  if (ticket.classList.contains('clasico')) {
    ticket.classList.remove('clasico');
    ticket.classList.add('moderno');
    label.textContent = 'Estilo actual: Moderno';
    btn.textContent = 'Modo clásico';
    body.classList.add('moderno'); // añadir clase moderno al body
  } else {
    ticket.classList.remove('moderno');
    ticket.classList.add('clasico');
    label.textContent = 'Estilo actual: Clásico';
    btn.textContent = 'Modo moderno';
    body.classList.remove('moderno'); // remover clase moderno del body
  }
});




document.getElementById('autor-btn').addEventListener('click', () => {
  const modal = document.getElementById('modal-autor');
  const openBtn = document.getElementById('autor-btn'); // botón abrir
  const closeBtn = modal.querySelector('.close-btn');

  function closeModal() {
    modal.classList.remove('active');
    document.body.style.overflow = '';
    openBtn.focus();
  }

  // Abrir modal
  modal.classList.add('active');
  modal.setAttribute('tabindex', '-1');
  modal.focus();
  document.body.style.overflow = 'hidden';

  // Listener para cerrar modal con botón cerrar
  closeBtn.addEventListener('click', closeModal, { once: true });

  // Listener para cerrar modal haciendo clic fuera del contenido
  modal.addEventListener('click', (e) => {
    if (e.target === modal) {
      closeModal();
    }
  }, { once: true });

  // Listener para cerrar modal con tecla Escape
  document.addEventListener('keydown', function escClose(e) {
    if (e.key === 'Escape' && modal.classList.contains('active')) {
      closeModal();
      document.removeEventListener('keydown', escClose);
    }
  });
});


document.addEventListener('contextmenu', event => event.preventDefault());

document.addEventListener('keydown', event => {
  if (event.key === 'F12' || 
     (event.ctrlKey && event.shiftKey && (event.key === 'I' || event.key === 'C' || event.key === 'J'))) {
    event.preventDefault();
  }
});




// ticketActions.js - Funcionalidad para compartir, imprimir y descargar tickets

(function() {
  'use strict';

  // Convertir el ticket a imagen y compartir
  async function shareTicketToWhatsApp() {
    try {
      const ticketElement = document.getElementById('ticket-wrapper');
      if (!ticketElement) {
        alert('No se encontró el ticket para compartir');
        return;
      }

      // Mostrar indicador de carga
      const shareBtn = document.getElementById('share-whatsapp-btn');
      const originalText = shareBtn.textContent;
      shareBtn.textContent = 'Generando...';
      shareBtn.disabled = true;

      // Convertir el ticket a canvas usando html2canvas
      const canvas = await html2canvas(ticketElement, {
        scale: 3,
        backgroundColor: '#ffffff',
        logging: false,
        useCORS: true
      });

      // Convertir canvas a blob
      const blob = await new Promise(resolve => {
        canvas.toBlob(resolve, 'image/png', 1.0);
      });

      // Crear un archivo con el blob
      const fileName = `ticket-comedor-${new Date().getTime()}.png`;
      const file = new File([blob], fileName, { type: 'image/png' });

      // Verificar si podemos compartir este archivo
      if (navigator.canShare && navigator.canShare({ files: [file] })) {
        await navigator.share({
          files: [file],
          title: 'Ticket Comedor UNSCH',
          text: 'Mi ticket del comedor universitario'
        });
        console.log('Imagen compartida exitosamente');
      } else {
        // Fallback: descargar la imagen si no se puede compartir
        downloadImage(canvas, fileName);
        alert('Tu dispositivo no soporta compartir archivos. La imagen se descargará.');
      }

      // Restaurar botón
      shareBtn.textContent = originalText;
      shareBtn.disabled = false;

    } catch (error) {
      console.error('Error al compartir:', error);
      
      // Restaurar botón en caso de error
      const shareBtn = document.getElementById('share-whatsapp-btn');
      if (shareBtn) {
        shareBtn.textContent = 'Compartir en WhatsApp';
        shareBtn.disabled = false;
      }

      // Si el error es porque el usuario canceló, no mostrar alerta
      if (error.name !== 'AbortError') {
        alert('Hubo un error al intentar compartir. Por favor, intenta nuevamente.');
      }
    }
  }

  // Función para descargar imagen (fallback)
  function downloadImage(canvas, fileName) {
    const link = document.createElement('a');
    link.download = fileName;
    link.href = canvas.toDataURL('image/png');
    link.click();
  }

  

  // Inicializar eventos cuando el DOM esté listo
  function initializeEventListeners() {
    // Mostrar botón de compartir solo si el dispositivo lo soporta
    if (navigator.share && navigator.canShare) {
      const shareBtn = document.getElementById('share-whatsapp-btn');
      if (shareBtn) {
        shareBtn.style.display = 'block';
      }
    }

    // Botón de compartir en WhatsApp (solo en móviles)
    const shareBtn = document.getElementById('share-whatsapp-btn');
    if (shareBtn) {
      shareBtn.addEventListener('click', shareTicketToWhatsApp);
    }
  }

  // Esperar a que el DOM esté listo
  if (document.readyState === 'loading') {
    document.addEventListener('DOMContentLoaded', initializeEventListeners);
  } else {
    initializeEventListeners();
  }

})();